import React from 'react';

function Results() {
  return (
    <div className="bg-white shadow rounded-lg p-6">
      <h1 className="text-2xl font-bold mb-4">Результаты</h1>
      <p>Здесь будут отображаться результаты обработки данных</p>
    </div>
  );
}

export default Results;
